Now that staying IN is the new going OUT, I can't help but revamp my spaces for a fresh new vibe every day! Big ups to @purefinefabrics.in for the inspiration with their amazing new initiative #FineTimesAtHome which is all about finding innovative and easy ways to experience the joys of the outdoors at home while we stay safe. With this, I decided to turn things up a notch from quarantine corners and set up a vibrant picnic date spot on my terrace, along with my sisters!🥂🍇🍒🧀👒💐 Hope you guys like it!! _

@kriti @harveen biggest hugs! Let's do this again please 🤗 . . . . . .

